		      #'NotifyClose'{uid = NFuid}, _) ->
    #'NotifyClose'{uid =
		       if NFuid =:= undefined -> PFuid;
			  true -> NFuid
		       end}.

merge_msg_HeartbeatRes(_Prev, New, _TrUserData) -> New.

