merge_msg_isOnlineRes(#isOnlineRes{online = PFonline,
				   seqID = PFseqID},
		      #isOnlineRes{online = NFonline, seqID = NFseqID}, _) ->
    #isOnlineRes{online =
		     if NFonline =:= undefined -> PFonline;
			true -> NFonline
		     end,
		 seqID =
		     if NFseqID =:= undefined -> PFseqID;
			true -> NFseqID
		     end}.

