verify_msg(Msg) -> verify_msg(Msg, []).

verify_msg(Msg, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case Msg of
      #'Broadcast'{} ->
	  v_msg_Broadcast(Msg, ['Broadcast'], TrUserData);
      #'Uids'{} -> v_msg_Uids(Msg, ['Uids'], TrUserData);
      #'ReportServerInfo'{} ->
	  v_msg_ReportServerInfo(Msg, ['ReportServerInfo'],
				 TrUserData);
      #'NotifyClose'{} ->
	  v_msg_NotifyClose(Msg, ['NotifyClose'], TrUserData);
      #'HeartbeatRes'{} ->
	  v_msg_HeartbeatRes(Msg, ['HeartbeatRes'], TrUserData);
      #'TickUser'{} ->
	  v_msg_TickUser(Msg, ['TickUser'], TrUserData);
      #'HeartbeatReq'{} ->
	  v_msg_HeartbeatReq(Msg, ['HeartbeatReq'], TrUserData);
      #isOnlineRes{} ->
	  v_msg_isOnlineRes(Msg, [isOnlineRes], TrUserData);
      #isPlayingGameRes{} ->
	  v_msg_isPlayingGameRes(Msg, [isPlayingGameRes],
				 TrUserData);
      #isOnlineReq{} ->
	  v_msg_isOnlineReq(Msg, [isOnlineReq], TrUserData);
      #isPlayingGameReq{} ->
	  v_msg_isPlayingGameReq(Msg, [isPlayingGameReq],
				 TrUserData);
      #'BroadcastByUID'{} ->
	  v_msg_BroadcastByUID(Msg, ['BroadcastByUID'],
			       TrUserData);
      #'UserAddGold'{} ->
	  v_msg_UserAddGold(Msg, ['UserAddGold'], TrUserData);
      #getOnlineUserNumRes{} ->
	  v_msg_getOnlineUserNumRes(Msg, [getOnlineUserNumRes],
				    TrUserData);
      #'BroadcastToGameServer'{} ->
	  v_msg_BroadcastToGameServer(Msg,
				      ['BroadcastToGameServer'], TrUserData);
      #getOnlineUserNumReq{} ->
	  v_msg_getOnlineUserNumReq(Msg, [getOnlineUserNumReq],
				    TrUserData);
      #forbiddenIp{} ->
	  v_msg_forbiddenIp(Msg, [forbiddenIp], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


